import React from 'react';

const Header = () => {
  return (
    <div>
      <div className='text-3xl font-bold '>
        <h1>E-Commerce Project</h1>
      </div>
      <div className='d'>
        <button>About</button>
        <button>Program List</button>
        <button>Community</button>
        <button>Contact</button>
      </div>
      <div>
        <button>Login</button>
        <button>Sign Up</button>
      </div>
    </div>
  );
}

export default Header;
